import React from 'react'
import './drop-down.styles.scss'

import useFetch from '../../effects/use-fetch.effect';

const CustomDropDown =({isAssets, isUsers, ...props}) => {

useFetch(`http://localhost:3000/users`, 'user-list');
useFetch(`http://localhost:3000/allunits`, 'asset-list');

    return(
        <div className='combo-box-container'  >
            <input  
                className = 'combo-box'
                type="text" 
                list={`${isAssets ? 'asset-list' : isUsers ? 'user-list' : '' }`}
                />
            <datalist id={`${isAssets ? 'asset-list' : isUsers ? 'user-list' : '' }`} >
            </datalist>
        </div>
    )
}

export default CustomDropDown;
